// File: /src/pages/Events.jsx
import React from "react";
import { Box, Typography } from "@mui/material";
import EventsCard from "../components/EventsCard";

const events = [
  {
    title: "Sunday Service",
    subtitle: "Every Sunday at 9:00am & 11:30am",
    image: "https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=400&q=80",
    date: "Every Sunday",
    description: "Join us for worship, teaching, and fellowship at Nairobi Chapel. All are welcome!",
  },
  {
    title: "Youth Night",
    subtitle: "Fridays at 6:00pm",
    image: "https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=400&q=80",
    date: "Every Friday",
    description: "A fun and faith-filled night for teens. Games, music, and Bible study!",
  },
  {
    title: "Community Outreach",
    subtitle: "Last Saturday of every month",
    image: "https://images.unsplash.com/photo-1519125323398-675f0ddb6308?auto=format&fit=crop&w=400&q=80",
    date: "Monthly",
    description: "Serve with us as we reach out to our local community with love and support.",
  },
  {
    title: "Prayer Meeting",
    subtitle: "Wednesdays at 7:00pm",
    image: "https://images.unsplash.com/photo-1517841905240-472988babdf9?auto=format&fit=crop&w=400&q=80",
    date: "Every Wednesday",
    description: "Join us for a powerful time of prayer and intercession in the main sanctuary.",
  },
];

const Events = () => (
  <Box sx={{ mt: 7, mb: 0, width: '100%', px: { xs: 2, md: 4 } }}>
    <Typography variant="h4" fontWeight={700} mb={3} color="#333">
      Events
    </Typography>
    {events.length === 0 ? (
      <Typography variant="body2" color="text.secondary">
        Nothing at the moment
      </Typography>
    ) : (
      <Box display="flex" flexWrap="wrap" gap={2}>
        {events.map((event, idx) => (
          <EventsCard key={idx} {...event} />
        ))}
      </Box>
    )}
  </Box>
);

export default Events;
